				(*C.char)(unsafe.Pointer(&b.log[0])), C.int(len(b.log)))
			if progFd < 0 {
				return fmt.Errorf("error while loading %q (%v):\n%s", section.Name, err, b.log)
			}

			switch {
			case isKprobe:
				fallthrough
			case isKretprobe:
				b.probes[secName] = &Kprobe{
					Name:  secName,
					insns: insns,
					fd:    int(progFd),
					efd:   -1,
				}
			case isCgroupSkb:
				fallthrough
			case isCgroupSock:
				b.cgroupPrograms[secName] = &CgroupProgram{
					Name:  secName,
					insns: insns,
					fd:    int(progFd),
				}
			case isSocketFilter:
				b.socketFilters[secName] = &SocketFilter{
					Name:  secName,
					insns: insns,
					fd:    int(progFd),
				}
			case isTracepoint:
				b.tracepointPrograms[secName] = &TracepointProgram{
					Name:  secName,
					insns: insns,
					fd:    int(progFd),
				}
			case isSchedCls:
				fallthrough
			case isSchedAct:
				b.schedPrograms[secName] = &SchedProgram{
					Name:  secName,
					insns: insns,
					fd:    int(progFd),
				}
			}
		}
	}

	return b.initializePerfMaps(parameters)
}
